import React, { useState } from 'react'
import picOfMe from '../images/me.jpeg'
import { Link } from 'react-router-dom';
import SectionHeader from './SectionHeader';

export default function Hero() {


    return (

        <section className="home-section active">
            <h1 className="hero-heading">Hello i am</h1>
            <h2>Signe Petersen</h2>
            <p>I am a webdeveloper</p>
            <img src={picOfMe} className="home-img"></img>
            <Link to="/projects"><button>Se mere </button></Link>

        </section>

    )
}
